            line-height: 4rem;
          }
          h2 {
            margin-left: 0;
            line-height: 3rem;
          }
        }
      }
    }

    .content7 {
      .roi_txt {
        flex-direction: column;

        img {
          width: 100%;
        }
      }
    }

    .content1 {
      display: flex;
      flex-wrap: wrap;
      height: 100%;
      padding: 0 2vw;
      padding-top: 10vh;

      .content1-clip {
