    footer {
      grid-gap: 40px;

      .location {
        grid-column: 1/3;
        grid-row: 2;
      }
      .icons {
        grid-column: 3/5;
        grid-row: 2;
      }
      .about {
        grid-column: 1/5;
        grid-row: 1;
      }
      .copyright {
        grid-column: 1/5;
        grid-row: 3;
      }
